let MealType = ['Breakfast', 'Lunch', 'Dinner', 'Snack'];
let DietLabel = [
  'balanced',
  'high-fiber',
  'high-protein',
  'low-carb',
  'low-fat',
  'low-sodium',
];

let DietType = ['vegan', 'vegetarian', 'pescatarian', 'paleo', 'kosher'];

const APP_ID = '143e5a61';
const APP_KEY = '1aba1110ee2c42dcaaeccce62c1f3e22';
export default function Recipes() {
  return (
    <div>
      Recipes
