          />
        ))}
      </div>
      <div>
        {DietLabel.map((diet, index) => (
          <RecipeFormButton
            text={diet}
            value={diet}
            // getValue={props.updateDiet}
            key={index}
          />
        ))}
      </div>
      <div>
        {DietType.map((diet, index) => (
          <RecipeFormButton
            text={diet}
            value={diet}
            // getValue={props.updateDiet}
            key={index}
          />
        ))}
      </div>
      <RecipeDropdown />
    </div>
  );
}
